clickToggle: function() {
		//------------------------------------------------------------------------------
		// Click Toggle
		//
		// Adds a "click"
		//
		// Add to the .click-toggle--trigger:
		// .click-toggle--always: add to the target to always toggle it away when pressing anywhere, even inside the target and/or the trigger
		//------------------------------------------------------------------------------

		$('html').on('click', function(event) {
			var target = event.target ? event.target : event.srcElement;
			if ($(target).closest('.click-toggle--trigger').length > 0) {
				$clickToggleTrigger = $(target).closest('.click-toggle--trigger');
				var clickToggleID = $clickToggleTrigger.attr('data-click-toggle--id');
				if ($clickToggleTrigger.hasClass('active')) {
					$clickToggleTrigger.removeClass('active');
					$('[data-click-toggle--id=' + clickToggleID + ']').removeClass('active');
				} else {
					$('.click-toggle--trigger').removeClass('active');
					$('[data-click-toggle--id]').removeClass('active');
					$clickToggleTrigger.addClass('active');
					$('[data-click-toggle--id=' + clickToggleID + ']').addClass('active');
				}
				if (!$(target).hasClass('allow-default')) {
					event.preventDefault();
				}
			} else if ( !($(target).closest('[data-click-toggle--id]').hasClass('active') && !($(target).closest('[data-click-toggle--id]').hasClass('click-toggle--always')) )) {
				// only close the clickToggle if the click is NOT in clicktoggle active area:
				$('.click-toggle--trigger').removeClass('active');
				$('[data-click-toggle--id]').removeClass('active');
			}
		});
},
