	//------------------------------------------------------------------------------
	// Pacâ€¢Nav
	//------------------------------------------------------------------------------
	pacNav: function() {
		var $pacNav = $('.pac-nav');
		$pacNav.removeClass('loaded');
		var $desktopNavItem;
		var $mobileNavItem;
		var swallowFlag = 0;
		var viewportOffset = 0;
		var totalNavItems = 0;
		var navToggleOffset = 0;
		// first check the viewport and add a an offset depending:
		var viewportWidth = $(window).width();
		if (viewportWidth >= 481 && viewportWidth < 1024) {
			viewportOffset = Math.floor((viewportWidth - 1024) * -0.20);
		}
		// } else if (viewportWidth >= 481 && viewportWidth <= 767) {
		//  viewportOffset = 60;
		// };

		// get the Mobile Anchor position in order to compare vs the menu items
		var mobileAnchor = Math.ceil($pacNav.find('.pac-nav--mobile-anchor').offset().left - $pacNav.find('.pac-nav--desktop-anchor').offset().left);

		// first time through and while the nav is hidden, yes z-index'd away, set the data positions for each desktop nav items:
		$pacNav.find('.pac-nav--desktop-nav > ul > li').each(function(index) {
			if (typeof $(this).attr('data-right-position') == 'undefined') {
				$(this).attr('data-right-position', Math.floor($(this).offset().left + $(this).width() - $pacNav.find('.pac-nav--desktop').offset().left));
			}
			totalNavItems++;
		});

		// run through all of the nav items to get their positions:
		for (var i = 0; i < totalNavItems; i++) {
			$desktopNavItem = $pacNav.find('.pac-nav--desktop-nav > ul > li:eq(' + i + ')');
			$mobileNavItem = $pacNav.find('.pac-nav--mobile-nav > ul > li:eq(' + i + ')');
			// run the functions if it hasn't been swallowed
			if (swallowFlag == 0) {
				if (i+1 == totalNavItems) {
					navToggleOffset = 0;
				} else {
					navToggleOffset = $pacNav.find('.pac-nav--nav-toggle').width();
				}
				if ($desktopNavItem.attr('data-right-position') - viewportOffset >= (mobileAnchor - navToggleOffset)) {
					$desktopNavItem.addClass('hide');
					$mobileNavItem.addClass('show');
					$pacNav.addClass('running').find('.pac-nav--mobile').attr('style','');
					swallowFlag = 1;
					if (i <= 1) {
						// if it's the first or second item
						// retroactively force the first one in the list to be hide since it looks weird if it's all alone
						$pacNav.find('.pac-nav--desktop-nav > ul > li:eq(0)').addClass('hide');
						$pacNav.find('.pac-nav--mobile-nav > ul > li:eq(0)').addClass('show');

						$pacNav.removeClass('running-desktop').addClass('running-mobile');
						$('body').removeClass('running-desktop').addClass('running-mobile');
					} else {
						$pacNav.removeClass('running-mobile').addClass('running-desktop');
						$('body').removeClass('running-mobile').addClass('running-desktop');
					}
				} else {
					$desktopNavItem.removeClass('hide');
					$mobileNavItem.removeClass('show');
					swallowFlag = 0;
				}
			} else {
				// earlier guys have already been swallowed so just swallow the next ones:
				$desktopNavItem.addClass('hide');
				$mobileNavItem.addClass('show');
			}
		}
		if (swallowFlag == 0) {
			// after all is done, if nothing is swallowed, clear out an pac-nav stuff
			$pacNav.removeClass('running-desktop').removeClass('running-mobile').removeClass('running');;
		}
		// set the offset now that everything is figured out:
		$pacNav.find('.pac-nav--desktop-nav > ul').css('margin-left', viewportOffset * -1 + 'px');

		// we're done, so let's declare us loaded:
		$pacNav.addClass('loaded');

		// addendum stuff:
		if ($pacNav.hasClass('running-mobile')) {
			$('.pac-nav--nav-toggle').off().removeClass('touch-hover'); // needs to have slide toggle;
			init.slideToggle();
		} else {
			$('.pac-nav--nav-toggle').off().addClass('touch-hover');
		}
	},
