	initToolip: function(){
		var targets = $( '[rel~=tooltip]' ),
		target  = false,
		tooltip = false,
		title   = false;

		targets.bind( 'mouseenter', function()
		{
			target  = $( this );
			tip     = target.attr( 'title' );
			tooltip = $( '<div id="tooltip"></div>' );

			if( !tip || tip == '' )
				return false;

			tooltip.css( 'opacity', 0 )
			.html( tip )
			.appendTo( 'body' );

			var init_tooltip = function()
			{
				if( $( window ).width() < tooltip.outerWidth() * 1.5 )
					tooltip.css( 'max-width', $( window ).width() / 2 );
				else
					tooltip.css( 'max-width', 420 );

				var pos_left = target.offset().left + ( target.outerWidth() / 2 ) - ( tooltip.outerWidth() / 2 ),
				pos_top  = target.offset().top - tooltip.outerHeight() - 20;

				if( pos_left < 0 )
				{
					pos_left = target.offset().left + target.outerWidth() / 2 - 20;
					tooltip.addClass( 'left' );
				}
				else
					tooltip.removeClass( 'left' );

				if( pos_left + tooltip.outerWidth() > $( window ).width() )
				{
					pos_left = target.offset().left - tooltip.outerWidth() + target.outerWidth() / 2 + 20;
					tooltip.addClass( 'right' );
				}
				else
					tooltip.removeClass( 'right' );

				if( pos_top < 0 )
				{
					var pos_top  = target.offset().top + target.outerHeight();
					tooltip.addClass( 'top' );
				}
				else
					tooltip.removeClass( 'top' );

				tooltip.css( { left: pos_left, top: pos_top } )
				.animate( { top: '+=10', opacity: 1 }, 50 );
			};

			init_tooltip();
			$( window ).resize( init_tooltip );

			var remove_tooltip = function()
			{
				tooltip.animate( { top: '-=10', opacity: 0 }, 50, function()
				{
					$( this ).remove();
				});

				target.attr( 'title', tip );
			};

			target.bind( 'mouseleave', remove_tooltip );
			tooltip.bind( 'click', remove_tooltip );
		});
},

siteHeader: function() {
	$(window).scroll(function () {
		if (!($('body').hasClass('running-mobile'))) {
			scrollPosition = $(window).scrollTop();
			if (scrollPosition > 112) {
				$('.site-header').css('height', '56px');
				$('.site-header > .inner').css('top','-28px');
				$('.site-header').addClass("site-header--scrolling");
			} else {
				$('.site-header').css('height',(112 - (Math.floor(scrollPosition/2))) + 'px');
				$('.site-header > .inner').css('top',(-1 * (Math.floor(scrollPosition/4)) + 'px'));
				$('.site-header').removeClass("site-header--scrolling");
			}
		} else {
			$('.site-header').removeAttr('style');
			$('.site-header > .inner').removeAttr('style');
		}
	});
},
touchHover: function() {
		//------------------------------------------------------------------------------
		// Touch Hover
		//
		// Description:
		//   Touch Hover adds a ".active" class on click and on mouseover.
		//   It removes ".active" when hovering off the .active or touching anywhere else.
		//
		// Requires:
		//   modernizr.js (adds the 'touch' and 'no-touch' class the the html element)
		//
		// Setup:
		//   Add 'touch-hover' class to any element you'd like to make "active" on touch.
		//   Optional:
		//     Witin 'touch-hover' element set 'data-touch-hover--target-recipient="any-name"'
		//     to point to data-touch-hover--target-name="any-name"
		//
		// Returns:
		//   Adds the 'active' class on hover or touch to the 'touch-hover' class
		//   Optionally adds 'active' to the 'data-touch-hover--target-name' element
		//
		// to do: must disable the close-touch event when inside the exposed area
		//------------------------------------------------------------------------------
		function touchHoverClear() {
			// only run the touchHoverClear after all the if statements have been run.
			// otherwise, you'll be clearing before you get answers. :)
$('.touch-hover').removeClass('active');
$('[data-touch-hover--target-name]').removeClass('active');
}
function touchHover(event,eventType) {
			// this is because older IE uses event.srcElement instead of event.target:
			var target = event.target ? event.target : event.srcElement;
			if ($(target).closest('.touch-hover').length > 0) {
				var touchHoverItem = $(target).closest('.touch-hover');

				if (eventType === 'click' && $(touchHoverItem).hasClass('active')) {
					// clear the hover by performing a 'click'
					if ( $(target).closest('.active[data-touch-hover--target-name]').length === 0) {
						touchHoverClear();
					}
				} else {
					if ( $(target).closest('.active[data-touch-hover--target-name]').length === 0) {
						touchHoverClear();
					}
					// check to see if there's data to make active:
					$(touchHoverItem).addClass('active');
					// make the data-touch-hover--target-recipient "hover" if available
					$('[data-touch-hover--target-name=' + $(touchHoverItem).attr('data-touch-hover--target-recipient') + ']').addClass('active');
				}
			} else if ( $(target).closest('.active[data-touch-hover--target-name]').length === 0) {
				touchHoverClear();
			}
		}

		// $('html').on('click', function(){ touchHover(); });
		$('html.touch').on('click', function(event){ touchHover(event,'click'); });
		$('html.no-touch').on('mouseover', function(event){ touchHover(event,'hover'); });
	},
	// OLD way of event tracking before GTM
	// googleEventClick: function(){
	//  $('#homepage-know-more').click(function() {
